const SessionAnswers = ({ answers, style }) => {
    return (
        <div className="played-song" style={style}>
            {answers.map((answer, key) =>
                <div key={key} className='answer-content'>
                    <img
                        src={answer.imageUrl}
                        alt=""
                        className='answer-image'
                    />
                    <div className='answer-details'>
                        <p>{answer.artist}</p>
                        <p>{answer.song}</p>
                    </div>
                    <div className='answer-type'>
                        {answer.score} points
                        </div>
                </div>
            )}
        </div>
    )
}



export default SessionAnswers
